 {
"agreement_type": "Memorandum of Understanding",
"description": "This is a Memorandum of Understanding (MOU) between CEDES (Commission on Ecology and Sustainable Development of the State of Sonora), the Municipality of San Luis Rio Colorado, and the Arizona Department of Environmental Quality. The parties agree to collaborate on environmental management and protection, including air quality, water quality, solid waste management, and green area expansion."
}

 {
"agreement_type": "Memorandum of Understanding (MOU)",
"description": "This Memorandum of Understanding (MOU) is between the Arizona-Mexico Commission and the Comision Sonora, aiming to mutually recognize the conditions and requirements to execute the '2015: Arizona and Sonora's New Border' Plan. The plan focuses on improving the infrastructure at Arizona's and Sonora's border ports of entry, addressing the issue of long wait times and outdated facilities, and increasing the throughput capacity at all major ports of entry by 2015."
}

