}

 {
"agreement_type": "Memorandum of Understanding",
"description": "This is a Memorandum of Understanding (MOU) among the Ministry of Environment and Natural Resources of the United Mexican States, the U.S. Fish and Wildlife Service, the Arizona Game and Fish Department, and the New Mexico Department of Game and Fish, for the conservation, management, and recovery of the Mexican Wolf (Canis lupus baileyi). The agreement acknowledges the historical extinction of the Mexican wolf in both the United States and Mexico and the subsequent development of the Mexican Wolf Recovery Plan in 1982. The parties aim to maintain a captive breeding program and reestablish viable, self-sustaining populations of the Mexican wolf within their historical ranges, with a goal of at least 320 individuals in the United States and 200 individuals in Mexico, while ensuring appropriate gene diversity."
